    elsif rising_edge(uart_baudclock) then
        case uart_rxstate is
            when RXSTATE_IDLE =>
                if (not bool(uart_rxfull)) then
                    if (rx = '0') then
                        uart_rxpushcs <= '0';
                        uart_rxstate <= RXSTATE_START;
                    end if;
                end if;
            when RXSTATE_START =>
                if (uart_rxcounter = 0) then
                    uart_rxpush <= '0';
                end if;
                if (((uart_rxcounter + 1) mod 16) = 0) then
                    uart_rxstate <= RXSTATE_DATA;
                end if;
                uart_rxcounter <= (uart_rxcounter + 1);
            when RXSTATE_DATA =>
                if (((uart_rxcounter + 1) mod 16) = 0) then
                    if (((uart_rxbitcounter + 1) mod 8) = 0) then
                        uart_rxstate <= RXSTATE_STOP;
                    end if;
                    uart_rxbitcounter <= (uart_rxbitcounter + 1);
                elsif (uart_rxcounter = (16 / 2)) then
                    uart_rxdatainbits(to_integer(uart_rxbitcounter)) <= rx;
                end if;
                uart_rxcounter <= (uart_rxcounter + 1);
            when others => -- RXSTATE_STOP
                if (uart_rxcounter = 0) then
                    uart_rxpush <= '1';
                end if;
                if (((uart_rxcounter + 1) mod 16) = 0) then
                    uart_rxpushcs <= '1';
                    uart_rxstate <= RXSTATE_IDLE;
                end if;
                uart_rxcounter <= (uart_rxcounter + 1);
        end case;
    end if;
