        uart_txstate <= TXSTATE_IDLE;
        uart_txbitcounter <= to_unsigned(0, 3);
        uart_txpopcs <= '1';
        uart_txcounter <= to_unsigned(0, 4);
    elsif rising_edge(uart_baudclock) then
        case uart_txstate is
            when TXSTATE_IDLE =>
                if (not bool(uart_txempty)) then
                    uart_txpopcs <= '0';
                    uart_txstate <= TXSTATE_START;
                end if;
            when TXSTATE_START =>
                if (uart_txcounter = 0) then
                    tx <= '0';
                    uart_txpop <= '0';
                end if;
                if (((uart_txcounter + 1) mod 16) = 0) then
                    uart_txstate <= TXSTATE_DATA;
                end if;
                uart_txcounter <= (uart_txcounter + 1);
            when TXSTATE_DATA =>
                txbit := to_unsigned(0, 4);
                txbit := resize(uart_txbitcounter, 4);
                if (uart_txcounter = 0) then
                    if (uart_txdataout(to_integer(txbit + 1)-1 downto to_integer(txbit)) = 1) then
