                end if;
                if (((uart_txcounter + 1) mod 16) = 0) then
                    if (((uart_txbitcounter + 1) mod 8) = 0) then
                        uart_txstate <= TXSTATE_STOP;
                    end if;
                    uart_txbitcounter <= (uart_txbitcounter + 1);
                end if;
                uart_txcounter <= (uart_txcounter + 1);
            when others => -- TXSTATE_STOP
                if ((uart_txcounter = 0) and (uart_txbitcounter = 0)) then
                    tx <= '1';
                    uart_txpop <= '1';
                elsif (((uart_txcounter + 1) mod 16) = 0) then
                    if (uart_txbitcounter = 1) then
                        uart_txbitcounter <= to_unsigned(0, 3);
                        uart_txstate <= TXSTATE_IDLE;
                        uart_txpopcs <= '1';
                    else
                        uart_txbitcounter <= (uart_txbitcounter + 1);
                    end if;
                end if;
                uart_txcounter <= (uart_txcounter + 1);
        end case;
    end if;
end process TOP_UART_TRANSMITTER;



